import { Component } from "react"

export class Login extends Component {
    render() {
        return (
           <div className="flex h-screen bg-[#44544]">
               <div className="h-auto mt-4 mb-4 pl-9 pr-9 mx-auto border-gray-500 border-[0.5px]">
                   <h2 className="">Sign In</h2>
               </div>

           </div>
        );
    }
};
